sys_variable_value.value:
(function execute(inputs, outputs) {
    var val=gs.getProperty(inputs.parameter);    
    if (!(val===null)) {
        var v=[];
        // outputs.outvar1=val;      
        var vala=val.split(",");
        for(var i=0;i<vala.length;i++) {
            v.push(vala[i]); 
        }
        outputs.outarr1=v;
    }
})(inputs, outputs);

